import React from 'react'
import '../App.css';
import Link from './Link.js';
import navItems from './NavItems.js';

export default function Navbar() {
  return (
    <nav className="nav-bar flex justify-center">
      {
      navItems.map((item)=>(
        <Link link={item.link} name={item.name}/>
      ))}
 </nav>
  )
}
